import React from 'react';
import FullpageWrapper from "./FullPageWrapper";

function App() {
  return (
    <div className="App">
      <ul id="myMenu">
        <li className="active"><a href="#firstPage">First section</a></li>
        <li><a href="#secondPage">Second section</a></li>
        <li><a href="#thirdPage">Third section</a></li>
      </ul>
      <FullpageWrapper/>
    </div>
  );
}

export default App;
